import React from 'react';
import './css/Main.css';
import axios from 'axios';

function ImageThumbnail(props) {
    return(
        <div className="col">
            <div className="grid-item border border-secondary">{this.props.id}</div>
        </div>
    )
}

export default ImageThumbnail;
